INSERT INTO `kd_mapel` (`id`, `mapel_id`, `tingkatan_kelas`, `jenis_kompetensi`, `tapel_id`, `kode_kd`, `kompetensi_dasar`, `created_at`, `updated_at`) VALUES
(1, 5, '3', '1', 5, '3.1', 'menggali informasi tentang konsep perubahan wujud benda dalam kehidupan sehari-hari yang disajikan dalam bentuk lisan, tulis, visual, dan/atau eksplorasi lingkungan', '2022-12-05 07:39:50', '2022-12-05 07:39:50'),
(2, 5, '3', '1', 5, '3.2', 'mencermati kosakata dalam teks tentang konsep ciri-ciri,kebutuhan (maknanan dan tempat hidup), pertumbuhan, dan perkembangan makhluk hidup yang ada di lingkungan setempat yang disajikan dalam bentuk lisan, tulis, visual, dan/atau eksplorasi lingkungan', '2022-12-05 07:39:50', '2022-12-05 07:39:50'),
(3, 5, '3', '1', 5, '3.3', 'menggali informasi tentang cara-cara perawatan tumbuhan dan hewan melalui wawancara dan/atau eksplorasi lingkungan', '2022-12-05 07:39:50', '2022-12-05 07:39:50'),
(4, 5, '3', '1', 5, '3.4', 'menguraikan pesan dalam dongeng yang disajikan secara lisan, tulis, dan visual dengan tujuan untuk kesenangan', '2022-12-05 07:39:50', '2022-12-05 07:39:50'),
(5, 5, '3', '1', 5, '3.5', 'mencermati ungkapan atau kalimat saran, masukan, dan penyelesaian masalah (sederhana) dalam teks tulis', '2022-12-05 07:39:50', '2022-12-05 07:39:50'),
(6, 5, '3', '2', 5, '4.1', 'menyajikan hasil informasi tentang konsep perubahan wujud benda dalam kehidupan sehari-hari dalam bentuk lisan, tulis, dan visual menggunakan kosakata baku dan kalimat efektif', '2022-12-05 07:39:50', '2022-12-05 07:39:50'),
(7, 5, '3', '2', 5, '4.2', 'menyajikan laporan tentang konsep ciri-ciri, kebutuhan (makanan dan tempat hidup), pertumbuhan dan perkembangan makhluk hidup yang ada di lingkungan setempat secara tertulis menggunakan kosakata baku dan kalimat efektif', '2022-12-05 07:39:50', '2022-12-05 07:39:50'),
(8, 5, '3', '2', 5, '4.3', 'menyajikan hasil waawancara tentang cara-cara perawatan tumbuhan dan hewan dalam bentuk tulis dan virtual menggunakan kosakata baku dan kalimat efektif', '2022-12-05 07:39:50', '2022-12-05 07:39:50'),
(9, 5, '3', '2', 5, '4.4', 'menggunakan pesan dalam dongeng sebagai bentuk ungkapan diri menggunakan kosakata baku dan kalimat efektif', '2022-12-05 07:39:50', '2022-12-05 07:39:50'),
(10, 5, '3', '2', 5, '4.5', 'memeragakan ungkapan atau kalimat saran, masukan, dan penyelesaian masalah (sederhana) sebagai bentuk ungkapan diri menggunakan kosakata baku dan kalimat efektif yang dibuat sendiri', '2022-12-05 07:39:50', '2022-12-11 08:11:42'),
(11, 3, '3', '1', 5, '3.1', 'memahami makna Q.S. an-Nasr dan al-Kausar', '2022-12-05 07:49:40', '2022-12-05 07:49:40'),
(12, 3, '3', '2', 5, '3.2', 'memahami Hadis yang terkait dengan perilaku mandiri, percaya diri, dan bertanggung jawab', '2022-12-05 07:49:40', '2022-12-05 07:49:40'),
(13, 3, '3', '1', 5, '3.3', 'memahami keesaan Allah Yang Maha Pencipta berdasarkan pengamatan terhadap dirinya dan makhluk ciptaan-Nya yang dijumpai di sekitar rumah dan sekolah', '2022-12-05 07:49:40', '2022-12-05 07:49:40'),
